import React from 'react';
import styled from 'styled-components';

const Div = styled.div`
    color:white;
    height: 40px;
    display: flex;
    flex
`

const Title = styled.div`
    color:Red;
    font-size: 2.3rem;

`

const HeaderNav = () => {
    return (
        <Div>
            <Title>
                Catch Movie
            </Title>
        </Div>
    );
};

export default HeaderNav;
